import React from "react";
import "./style.css";
import flower from "../images/flower.png";
const MainPage = () => {
  return (
    <div id="main">
      <div id="container">
        <img src={flower} width={"200px"} height={"200px"} style={"20px"} />
        <h2>Will you be my valentine bb?</h2>
        <div id="button-container">
          <button type="button" id="yes-btn" className="buttons">
            Yes
          </button>
          <button type="button" id="no-btn" className="buttons">
            No
          </button>
        </div>
      </div>
    </div>
  );
};
export default MainPage;
